import React from 'react';
import './App.css';
import Navigation from './Navigation';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav, Navbar, Button, Carousel } from 'react-bootstrap';
import Scarf1 from './Assets/scarf1.jpg';
import Scarf2 from './Assets/scarf2.jpg';

function Home() {
  return (
    <div className='home'>
      <Carousel>
  <Carousel.Item>
    <img src={Scarf1} />
    <Carousel.Caption>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img src={Scarf2} />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src="scarf1.jpg/800x400?text=Third"
      alt="Third slide"
    />

    <Carousel.Caption>
      <h3>Third slide label</h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>
    </div>
  );
}

export default Home;
